sparqlQuery:
SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Country>
      { ?uri  <http://dbpedia.org/ontology/currency>  <http://dbpedia.org/resource/Euro> }
    UNION
      { ?uri  <http://dbpedia.org/property/currencyCode>  "EUR"@en }
  }

SELECT DISTINCT  ?n
WHERE
  { ?x  a                     <http://dbpedia.org/ontology/BasketballPlayer> ;
        <http://dbpedia.org/ontology/league>  <http://dbpedia.org/resource/National_Basketball_Association> ;
        <http://dbpedia.org/ontology/height>  ?n
    FILTER NOT EXISTS { ?x  <http://dbpedia.org/ontology/activeYearsEndYear>  ?d }
  }
ORDER BY ASC(?n)
OFFSET  0
LIMIT   1

SELECT DISTINCT  ?uri
WHERE
  { ?uri  <http://dbpedia.org/property/trailheads>  <http://dbpedia.org/resource/Grand_Canyon>
    FILTER NOT EXISTS { ?uri  <http://dbpedia.org/property/hazards>  <http://dbpedia.org/resource/Flash_flood> }
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/River> ;
          <http://dbpedia.org/ontology/riverMouth>  <http://dbpedia.org/resource/North_Sea>
  }

select ?uri ?a where {
 ?uri dct:subject <http://dbpedia.org/resource/Category:Russian_cosmonauts> ; 
foaf:gender ?a FILTER (str (?a)="female") }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type      dbo:Film ;
          dbo:starring  res:Brad_Pitt ;
          dbo:director  res:Guy_Ritchie
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/River> ;
          <http://dbpedia.org/ontology/country>  <http://dbpedia.org/resource/China> ;
          <http://dbpedia.org/property/length>  ?l
  }
ORDER BY DESC(?l)
OFFSET  0
LIMIT   1

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  dbp:  <http://dbpedia.org/property/>

SELECT DISTINCT  ?uri
WHERE
  { ?x  dbo:director  res:William_Shatner ;
        dbo:starring  res:William_Shatner
      { ?x  dbo:starring  ?uri }
    UNION
      { ?x  dbp:starring  ?uri }
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type    dbo:Monarch ;
          dbo:spouse  ?spouse
      { ?spouse  dbo:birthPlace  res:Germany }
    UNION
      { ?spouse  dbo:birthPlace  ?p .
        ?p       dbo:country     res:Germany
      }
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  <http://dbpedia.org/ontology/birthPlace>  <http://dbpedia.org/resource/Canada> ;
          <http://dbpedia.org/ontology/residence>  <http://dbpedia.org/resource/United_States>
  }

SELECT DISTINCT  ?uri
WHERE
  { ?uri  a                     <http://dbpedia.org/ontology/Film> ;
          <http://dbpedia.org/ontology/country>  <http://dbpedia.org/resource/Czech_Republic>
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  dbp:  <http://dbpedia.org/property/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type  dbo:Organisation
      { ?uri  dbo:formationYear  ?date }
    UNION
      { ?uri  dbo:foundingYear  ?date }
    UNION
      { ?uri  dbp:foundation  ?date }
    UNION
      { ?uri  dbp:formation  ?date }
    FILTER regex(?date, "^1950")
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  yago: <http://dbpedia.org/class/yago/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type        yago:WikicatDaughtersOfBritishEarls ;
          dbo:birthPlace  ?x ;
          dbo:deathPlace  ?y
    FILTER ( ?x != ?y )
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  yago: <http://dbpedia.org/class/yago/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  dbp:  <http://dbpedia.org/property/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT  ?uri
WHERE
  {   { ?uri  rdf:type  yago:ArgentineFilms }
    UNION
      { ?uri  rdf:type  dbo:Film
          { ?uri  dbo:country  res:Argentina }
        UNION
          { ?uri  dbp:country  "Argentina"@en }
      }
  }

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX onto: <http://dbpedia.org/ontology/>
PREFIX prop: <http://dbpedia.org/property/>
PREFIX res:  <http://dbpedia.org/resource/>
SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri rdf:type onto:Software .
      { ?uri prop:publisher 'Mean Hamster Software'@en . }
      UNION 
      { ?uri onto:publisher res:Mean_Hamster_Software . }
	OPTIONAL {?uri rdfs:label ?string . FILTER (lang(?string) = 'en') }
}

SELECT  ?uri WHERE{

?uri dct:subject <http://dbpedia.org/resource/Category:Capitals_in_Europe>

}
